const videos = [
{
    name: '1',
    duration: 15,
},
{
    name: '2',
    duration: 15,
},
{
    name: '3',
    duration: 15,
}
]
export function VideoList(){
    return (
        <>
        <h1>VideoList</h1>
        {
            videos.map((video) => {
                return (
                    <div>
                        <p></p>
                        <p></p>
                        <button></button>
                    </div>
                )
            })
        }
        </>
    )
}
